  public boolean areFamily(String child, String ancestor) {
    if(child.equals(ancestor))
      return true;
    while (child != null) {
      String childParent = this.clazzHierarchy.get(child);
      if (childParent != null && childParent.equals(ancestor)) {
        return true;
      } else {
        child = childParent;
      }
    }
    return false;
  }
  
